entry.string:
ISRUNNING='';
ATTEMPTS=20;
while [ -z "$ISRUNNING" ] && [ $ATTEMPTS -gt 0 ]; 
    do echo "Not completed..."; 
    helm upgrade scrapy-apple-jobs k8s/helm/ --set SPIDER_IMAGE=alexshrugged92/apple_jobs:289206b --set SPIDER_NAME=scrapy-apple-jobs --set SPIDER_REPLICAS=2 --set 5=5
    ISRUNNING="$(kubectl get job scrapy-job-scrapy-apple-jobs -o jsonpath='{.status}' | grep '"active":2' | grep 'ready":2')" || ISRUNNING='';
    ATTEMPTS=$((ATTEMPTS-1));
    sleep 5;
done;
